INSERT INTO `cms_block` VALUES (1,'banner_large','banner_large','<style>#html-body [data-pb-style=T3RKT1L]{justify-content:flex-start;display:flex;flex-direction:column;background-position:left top;background-size:cover;background-repeat:no-repeat;background-attachment:scroll}</style><div data-content-type=\"row\" data-appearance=\"contained\" data-element=\"main\"><div data-enable-parallax=\"0\" data-parallax-speed=\"0.5\" data-background-images=\"{}\" data-background-type=\"image\" data-video-loop=\"true\" data-video-play-only-visible=\"true\" data-video-lazy-load=\"true\" data-video-fallback-src=\"\" data-element=\"inner\" data-pb-style=\"T3RKT1L\"><div data-content-type=\"html\" data-appearance=\"default\" data-element=\"main\">&lt;div class=\"custom-2block-container\"&gt;\r\n  &lt;div class=\"custom-block left-block\"&gt;\r\n      &lt;div class=\"scrolling-text-container\"&gt;\r\n  &lt;div class=\"scrolling-text\"&gt;\r\n    &lt;p&gt;Chào mừng bạn đến với cửa hàng trực tuyến nơi mọi nhu cầu mua sắm của bạn đều được đáp ứng một cách nhanh chóng và tiện lợi.&lt;/p&gt;\r\n    &lt;p&gt;Khuyến mãi đặc biệt dành cho khách hàng mới: Giảm ngay 20% cho đơn hàng đầu tiên khi đăng ký tài khoản hôm nay.&lt;/p&gt;\r\n    &lt;p&gt;Miễn phí vận chuyển toàn quốc cho tất cả đơn hàng từ 500,000đ trở lên - cơ hội không thể bỏ lỡ!&lt;/p&gt;\r\n    &lt;p&gt;Khám phá bộ sưu tập thời trang xuân hè mới nhất với thiết kế hiện đại và chất liệu cao cấp.&lt;/p&gt;\r\n    &lt;p&gt;Cập nhật mỗi tuần các sản phẩm mới trong danh mục phụ kiện thời trang được ưa chuộng nhất hiện nay.&lt;/p&gt;\r\n    &lt;p&gt;Giảm giá sốc đến 50% cho các mặt hàng điện tử và công nghệ trong chương trình Flash Sale hôm nay.&lt;/p&gt;\r\n    &lt;p&gt;Chỉ trong hôm nay, mua một sản phẩm bất kỳ bạn sẽ nhận được một phiếu quà tặng trị giá 100,000đ.&lt;/p&gt;\r\n    &lt;p&gt;Tham gia chương trình khách hàng thân thiết và tích lũy điểm để đổi lấy hàng ngàn phần quà hấp dẫn.&lt;/p&gt;\r\n    &lt;p&gt;Nhận ngay quà tặng đặc biệt khi mua sắm tại chuyên mục Gia dụng với hóa đơn trên 1 triệu đồng.&lt;/p&gt;\r\n    &lt;p&gt;Các sản phẩm chăm sóc da từ thương hiệu nổi tiếng đang có giá ưu đãi chỉ trong 48 giờ.&lt;/p&gt;\r\n    &lt;p&gt;Trang sức thủ công cao cấp được chế tác tỉ mỉ, mang đậm phong cách cá nhân dành cho bạn.&lt;/p&gt;\r\n    &lt;p&gt;Bộ sưu tập giày sneaker mới ra mắt đang được các tín đồ thời trang săn đón nồng nhiệt.&lt;/p&gt;\r\n    &lt;p&gt;Đặc biệt dành riêng cho học sinh sinh viên: Giảm 10% cho tất cả mặt hàng học tập và văn phòng phẩm.&lt;/p&gt;\r\n    &lt;p&gt;Khám phá dòng sản phẩm đồ chơi giáo dục giúp phát triển trí tuệ cho trẻ em ở mọi lứa tuổi.&lt;/p&gt;\r\n    &lt;p&gt;Ưu đãi chỉ có tại cuối tuần: Mua 2 tặng 1 cho các sản phẩm nội thất và trang trí nhà cửa.&lt;/p&gt;\r\n    &lt;p&gt;Bạn đang tìm kiếm món quà ý nghĩa? Danh mục Quà tặng đặc biệt đang có hàng trăm lựa chọn hấp dẫn.&lt;/p&gt;\r\n    &lt;p&gt;Khuyến mãi lên đến 60% cho các sản phẩm đồ bếp từ các thương hiệu hàng đầu thế giới.&lt;/p&gt;\r\n    &lt;p&gt;Hãy nâng tầm không gian sống với bộ sưu tập đèn trang trí phong cách hiện đại và cổ điển.&lt;/p&gt;\r\n    &lt;p&gt;Chương trình Ưu đãi tháng sinh nhật: Mỗi ngày đều có khuyến mãi dành riêng cho bạn.&lt;/p&gt;\r\n    &lt;p&gt;Giảm giá cực mạnh cho danh mục dụng cụ thể thao - bắt đầu hành trình tập luyện ngay hôm nay.&lt;/p&gt;\r\n    &lt;p&gt;Khám phá dòng sản phẩm thân thiện môi trường, vì một cuộc sống xanh và bền vững hơn.&lt;/p&gt;\r\n    &lt;p&gt;Tặng kèm sản phẩm làm sạch da khi mua bất kỳ mặt hàng mỹ phẩm nào từ 500,000đ trở lên.&lt;/p&gt;\r\n    &lt;p&gt;Chỉ hôm nay, giảm giá toàn bộ mặt hàng đồng hồ thời trang nam và nữ đến 40%.&lt;/p&gt;\r\n    &lt;p&gt;Giao hàng siêu tốc trong vòng 2 giờ tại khu vực nội thành cho các sản phẩm được chọn lọc.&lt;/p&gt;\r\n    &lt;p&gt;Đổi trả miễn phí trong vòng 30 ngày nếu bạn không hài lòng với sản phẩm đã mua.&lt;/p&gt;\r\n    &lt;p&gt;Cập nhật bảng xếp hạng những sản phẩm bán chạy nhất trong tuần để bạn không bỏ lỡ xu hướng.&lt;/p&gt;\r\n    &lt;p&gt;Mỗi lượt giới thiệu bạn bè thành công, bạn sẽ nhận được voucher mua sắm trị giá 50,000đ.&lt;/p&gt;\r\n    &lt;p&gt;Hãy thử ngay dịch vụ đóng gói quà chuyên nghiệp miễn phí khi mua sắm tại gian hàng quà tặng.&lt;/p&gt;\r\n    &lt;p&gt;Ưu đãi riêng cho hội viên VIP: Ưu tiên giao hàng, tư vấn riêng và giảm giá sâu hơn mỗi tuần.&lt;/p&gt;\r\n    &lt;p&gt;Mỗi ngày là một cơ hội: Khám phá deal độc quyền chỉ hiển thị trong vòng 24 giờ!&lt;/p&gt;\r\n    &lt;p&gt;Mùa hè đến rồi, sắm ngay các thiết bị làm mát như quạt, máy lạnh, máy tạo độ ẩm với giá tốt nhất.&lt;/p&gt;\r\n    &lt;p&gt;Top sản phẩm đồ dùng văn phòng hiện đại giúp bạn làm việc hiệu quả và thoải mái hơn.&lt;/p&gt;\r\n    &lt;p&gt;Giảm giá sâu cho các combo thực phẩm hữu cơ chất lượng cao – bảo vệ sức khỏe gia đình bạn.&lt;/p&gt;\r\n    &lt;p&gt;Không thể bỏ lỡ: Các sản phẩm công nghệ mới nhất vừa ra mắt đang có giá ưu đãi hấp dẫn.&lt;/p&gt;\r\n    &lt;p&gt;Giảm giá cực mạnh cho phụ kiện máy tính và laptop – trang bị góc làm việc chuyên nghiệp.&lt;/p&gt;\r\n    &lt;p&gt;Bạn yêu thú cưng? Danh mục sản phẩm cho chó mèo đang giảm giá lên đến 30%!&lt;/p&gt;\r\n    &lt;p&gt;Mua sắm dễ dàng, thanh toán linh hoạt với nhiều phương thức: chuyển khoản, COD, ví điện tử.&lt;/p&gt;\r\n    &lt;p&gt;Nhận email thông báo khuyến mãi hằng ngày để không bao giờ bỏ lỡ những cơ hội tiết kiệm.&lt;/p&gt;\r\n    &lt;p&gt;Thưởng thức trải nghiệm mua sắm trực tuyến an toàn, nhanh chóng, và đáng tin cậy nhất hiện nay.&lt;/p&gt;\r\n    &lt;p&gt;Gian hàng Mỹ phẩm Hàn Quốc đang mở bán giới hạn với mức giảm giá sốc trong tuần này.&lt;/p&gt;\r\n    &lt;p&gt;Hàng trăm sản phẩm được đánh giá 5 sao từ người dùng thật – bạn sẽ không thất vọng!&lt;/p&gt;\r\n    &lt;p&gt;Ưu đãi độc quyền khi thanh toán qua ví điện tử ShopeePay hoặc Momo – tiết kiệm đến 15%.&lt;/p&gt;\r\n    &lt;p&gt;Bạn muốn tân trang căn bếp? Đừng bỏ qua bộ dụng cụ nấu ăn đa năng đang giảm giá cực sốc!&lt;/p&gt;\r\n    &lt;p&gt;Cập nhật xu hướng trang điểm mới nhất với các sản phẩm makeup đến từ Hàn, Nhật, Âu Mỹ.&lt;/p&gt;\r\n    &lt;p&gt;Mở bán giới hạn các mẫu túi xách thời trang hot trend - số lượng có hạn, nhanh tay kẻo lỡ!&lt;/p&gt;\r\n    &lt;p&gt;Chăm sóc sức khỏe chủ động với các loại thực phẩm bổ sung đang được giảm giá đến 35%.&lt;/p&gt;\r\n    &lt;p&gt;Thêm vào giỏ hàng các sản phẩm được đề cử trong mục \"Mua nhiều nhất\" để nhận ưu đãi bất ngờ.&lt;/p&gt;\r\n    &lt;p&gt;Khám phá chương trình ưu đãi trả góp lãi suất 0% cho đơn hàng từ 3 triệu đồng trở lên.&lt;/p&gt;\r\n    &lt;p&gt;Đừng bỏ lỡ khuyến mãi cuối tháng – hàng loạt sản phẩm giảm giá sâu đang chờ bạn!&lt;/p&gt;\r\n    &lt;p&gt;Tiết kiệm thời gian và công sức khi đặt hàng với tính năng tìm kiếm và lọc sản phẩm thông minh.&lt;/p&gt;\r\n    &lt;p&gt;Truy cập ứng dụng di động để nhận mã giảm giá đặc biệt dành riêng cho người dùng app.&lt;/p&gt;\r\n    &lt;p&gt;Ưu đãi mới mỗi ngày – mỗi lần truy cập là một cơ hội tiết kiệm không thể bỏ qua.&lt;/p&gt;\r\n    &lt;p&gt;Với mỗi sản phẩm bạn mua, chúng tôi đóng góp vào các chương trình từ thiện và bảo vệ môi trường.&lt;/p&gt;\r\n    &lt;p&gt;Trọn bộ sản phẩm trang điểm cơ bản với mức giá chưa từng có – phù hợp với cả người mới bắt đầu.&lt;/p&gt;\r\n    &lt;p&gt;Khám phá các giải pháp làm đẹp tại nhà từ chuyên gia – có thể bạn sẽ bất ngờ với kết quả.&lt;/p&gt;\r\n    &lt;p&gt;Tặng thêm thời gian bảo hành cho các sản phẩm công nghệ cao khi đăng ký thành viên hôm nay.&lt;/p&gt;\r\n    &lt;p&gt;Đăng ký nhận tin để không bỏ lỡ các đợt mở bán sản phẩm độc quyền chỉ có tại cửa hàng chúng tôi.&lt;/p&gt;\r\n    &lt;p&gt;Miễn phí lắp đặt cho các sản phẩm điện tử, gia dụng lớn trong khu vực nội thành Hà Nội và TP.HCM.&lt;/p&gt;\r\n    &lt;p&gt;Trang sức bạc cao cấp nhập khẩu đang có giá tốt nhất trong năm – duy nhất trong tuần này.&lt;/p&gt;\r\n    &lt;p&gt;Mở bán bộ sưu tập thời trang công sở mùa mới – sang trọng, tinh tế, giá cực kỳ hợp lý.&lt;/p&gt;\r\n    &lt;p&gt;Ghé thăm chuyên mục “Người dùng đánh giá” để đọc cảm nhận thực tế trước khi mua hàng.&lt;/p&gt;\r\n    &lt;p&gt;Tham gia mini game mỗi tuần để nhận mã giảm giá, quà tặng và cơ hội mua sắm miễn phí!&lt;/p&gt;\r\n    &lt;p&gt;Đừng quên kiểm tra mục “Hôm nay có gì hot?” để luôn nắm bắt cơ hội mua sắm thông minh.&lt;/p&gt;\r\n    &lt;p&gt;Ưu đãi đặc biệt cho đơn hàng đầu tiên trong ngày – mỗi ngày một phần quà bất ngờ!&lt;/p&gt;\r\n    &lt;p&gt;Các mẫu kính thời trang đang được giới trẻ săn đón đang giảm đến 50% – số lượng có hạn!&lt;/p&gt;\r\n    &lt;p&gt;Trang trí nhà cửa với bộ sưu tập gối, rèm, và thảm trải sàn giảm đến 70% chỉ trong tuần này.&lt;/p&gt;\r\n    &lt;p&gt;Đừng để lỡ siêu ưu đãi cho combo chăm sóc toàn thân – chăm sóc bản thân chưa bao giờ dễ dàng đến thế!&lt;/p&gt;\r\n    &lt;p&gt;Các mặt hàng sách kỹ năng, tiểu thuyết, thiếu nhi đều đang giảm giá mạnh – sắm ngay cho gia đình!&lt;/p&gt;\r\n    &lt;p&gt;Giảm thêm 10% cho các đơn hàng thanh toán qua thẻ tín dụng của các ngân hàng đối tác.&lt;/p&gt;\r\n    &lt;p&gt;Đội ngũ chăm sóc khách hàng luôn sẵn sàng hỗ trợ bạn 24/7 qua chat, hotline và email.&lt;/p&gt;\r\n    &lt;p&gt;Trang mua sắm duy nhất bạn cần – mọi thứ đều có, giá cả hợp lý, chất lượng được đảm bảo.&lt;/p&gt;\r\n  &lt;/div&gt;\r\n&lt;/div&gt;\r\n\r\n    &lt;/div&gt;\r\n\r\n  &lt;div class=\"custom-block right-block\"&gt;\r\n\r\n&lt;img src=\"{{media url=.renditions/catalog/category/store.png}}\" alt=\"\" /&gt;\r\n  &lt;/div&gt;\r\n&lt;/div&gt;\r\n\r\n&lt;style&gt;\r\n  .custom-2block-container {\r\n    display: flex;\r\n    flex-wrap: wrap;\r\n    gap: 20px;\r\n    justify-content: space-between;\r\n    margin: 40px 0;\r\n\r\n  }\r\n\r\n  .custom-block {\r\n    flex: 1 1 45%;\r\n    padding: 20px;\r\n    border: 1px solid #ddd;\r\n    background-color: #fdfdfd;\r\n    box-shadow: 0 2px 8px rgba(0,0,0,0.05);\r\n    border-radius: 8px;\r\n  }\r\n\r\n  .left-block h2 {\r\n    margin-top: 0;\r\n    font-size: 30px;\r\n    color: #333;\r\n  }\r\n\r\n  .cta-button {\r\n    margin-top: 15px;\r\n    padding: 10px 20px;\r\n    background-color: #007aff;\r\n    color: white;\r\n    border: none;\r\n    border-radius: 4px;\r\n    cursor: pointer;\r\n    transition: background-color 0.3s ease;\r\n  }\r\n\r\n  .cta-button:hover {\r\n    background-color: #005bb5;\r\n  }\r\n\r\n  .responsive-img {\r\n    width: 100%;\r\n    height: auto;\r\n    border-radius: 6px;\r\n  }\r\n .scrolling-text-container {\r\n      overflow: hidden;\r\n      position: relative;\r\n      border-radius: 4px;\r\n  font-size: 20px; /* tăng cỡ chữ */\r\n  /* Chiều cao linh hoạt */\r\n  min-height: 60px;      /* Đảm bảo hiển thị tối thiểu khoảng 2–3 dòng */\r\n  max-height: 1200px;     /* Không vượt quá 6 dòng, nếu có quá nhiều nội dung */\r\n  height: 540px;          /* Tự động theo nội dung nếu trong giới hạn trên */\r\ncolor: black;\r\n    }\r\n\r\n    .scrolling-text {\r\n      display: block;\r\n      position: absolute;\r\n      top: 0;\r\n      width: 100%;\r\n      line-height: 20px; /* Consistent line height for calculation */\r\n      animation: scroll-up 16.66s linear infinite;\r\n    }\r\n\r\n    .scrolling-text p {\r\n      margin: 16px 0;        /* Tăng khoảng cách trên và dưới */\r\n  line-height: 1.8;   \r\n      padding: 0;\r\n white-space: normal; /* Cho phép xuống dòng */\r\n    }\r\n\r\n    @keyframes scroll-up {\r\n      0% {\r\n        transform: translateY(0);\r\n      }\r\n      100% {\r\n        transform: translateY(-2000px); /* 100 lines × 20px */\r\n      }\r\n    }\r\n  @media screen and (max-width: 768px) {\r\n    .custom-2block-container {\r\n      flex-direction: column;\r\n    }\r\n.scrolling-text-container {\r\n    height: 100px;\r\n  }\r\n  }\r\n&lt;/style&gt;</div></div></div>','2025-04-14 08:42:11','2025-04-17 10:27:45',1),(2,'banner_small_1','banner_small_1','<style>#html-body [data-pb-style=NWU99KT]{justify-content:flex-start;display:flex;flex-direction:column;background-position:left top;background-size:cover;background-repeat:no